The results.flag values are infered from the options and the flag types are validated eg
```ts
const cli4 = meow({
    flags: {
        unicorn: {
            type: 'boolean',
            alias: 'u'
        },
        fooBar: 'string',
        someWrongFlag: "asdf", // error
    }
});
cli4.flags.unicorn;
cli4.flags.fooBar;
cli4.flags.asd // error
```

This requires typescript v2.8 I think

