Previously this was:
```ts
declare namespace newrelic {
    interface NewRelicAPI { ... }
}
declare const api: newrelic.NewRelicAPI;
export = api;
```

This is unnecessary as we can just export all the contents of `NewRelicAPI` directly at the top-level.

